import React from 'react';
import { } from 'bootstrap';
import '../../assect/css/mycss.css'

var api_key = f1f66ef328ad5089cd48bdf7d7cb81f6;

class Weather extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            city: undefined,
            country: undefined
          };
    }

    componentDidMount(){
        fetch(`https://api.openweathermap.org/data/2.5/weather?q=London,uk&appid=f1f66ef328ad5089cd48bdf7d7cb81f6`)
        .then(response => response.json())
        .then(json => console.log(json))    
      }
    render(){
        const {userId, title , id, completed} = this.state;
        return(
            <div className="App">
            <header className="App-header">
              <div>
                <h1>UserId</h1>
                {userId}
              </div>
              <div>
                <h1>completed</h1>
                {completed}
              </div>
              <div>
                <h1>Id</h1>
                {id}
              </div>
              <div>
                <h1>title</h1>
                {title}
              </div>

            </header>
          </div>
        );
    }
}

export default Weather ;


